import React, { useEffect, useState } from "react";
import { Layout, Menu, Table, Card, Button, Row, Col } from "antd";
import { BellOutlined } from '@ant-design/icons';
import ScheduleRepair from './ScheduleRepair'; // Assuming you have this component for scheduling
import axios from "axios";

const { Header, Content } = Layout;

const Dashboard = () => {
  const [appointments, setAppointments] = useState([]);

  // Fetch appointments from backend
  const fetchAppointments = async () => {
    const account = JSON.parse(localStorage.getItem("account")); // Use this to handle user auth
    const response = await axios.get("http://localhost:5235/api/ScheduledRepairs/appointments", {
      headers: { Authorization: `Bearer ${account.token}` }
    });
    setAppointments(response.data);
  };

  useEffect(() => {
    fetchAppointments();
  }, []);

  // Table columns for appointments
  const columns = [
    {
      title: 'Title',
      dataIndex: 'title',
      key: 'title',
    },
    {
      title: 'Description',
      dataIndex: 'description',
      key: 'description',
    },
    {
      title: 'Repair Date',
      dataIndex: 'repairDate',
      key: 'repairDate',
    },
    {
      title: 'Status',
      dataIndex: 'status',
      key: 'status',
      render: (status) => <span style={{ color: status === 'Pending' ? 'orange' : 'green' }}>{status}</span>
    },
  ];

  return (
    <Layout style={{ minHeight: "100vh", background: "#f0f2f5" }}> {/* Set full height background */}
      <Header style={{ background: '#fff', padding: '0 50px' }}>
        <Menu theme="light" mode="horizontal" style={{ display: 'flex', justifyContent: 'space-between' }}>
          <div>
            <Menu.Item key="1">Home</Menu.Item>
            <Menu.Item key="2">Dashboard</Menu.Item>
            <Menu.Item key="3">FAQ</Menu.Item>
          </div>
          <div>
            <BellOutlined />
            <span style={{ marginLeft: '10px' }}>Logged in as: <strong>work</strong></span>
            <Button type="primary" style={{ marginLeft: '20px' }}>Logout</Button>
          </div>
        </Menu>
      </Header>

      <Content style={{ padding: '50px', backgroundImage: 'url(/your-background-image.jpg)', backgroundSize: 'cover' }}>
        <h1 style={{ textAlign: 'center', marginBottom: '30px' }}>Welcome to Your Dashboard</h1>

        {/* Cards for scheduling and requests */}
        <Row gutter={16} justify="center" style={{ marginBottom: '50px' }}>
          <Col span={8}>
            <Card
              hoverable
              cover={
                <img
                  alt="Schedule Repair Appointment"
                  src="https://your-s3-image-url-or-cdn-path.jpg"
                  style={{ objectFit: 'cover', height: '150px' }}
                />
              }
            >
              <Card.Meta title="Schedule Repair Appointment" description={<ScheduleRepair />} />
            </Card>
          </Col>
          <Col span={8}>
            <Card
              hoverable
              cover={
                <img
                  alt="Submit a Request"
                  src="https://your-s3-image-url-or-cdn-path.jpg"
                  style={{ objectFit: 'cover', height: '150px' }}
                />
              }
            >
              <Card.Meta title="Submit a Request" description={<Button type="primary">Submit Now</Button>} />
            </Card>
          </Col>
        </Row>

        {/* Table for Appointments */}
        <h2 style={{ textAlign: 'center' }}>Your Appointments</h2>
        <Table
          dataSource={appointments}
          columns={columns}
          pagination={{ pageSize: 5 }}
          style={{ width: '90%', margin: '0 auto', background: '#fff', padding: '20px', borderRadius: '8px' }}
        />
      </Content>
    </Layout>
  );
};

export default Dashboard;
